// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.0 <8.10.0;

contract SimpleAuction{
    address payable public beneficiary;  // 受益人
    uint public auctionEnd; // 拍卖结束

    address public highestBidder; // 最高投标人
    uint public highestBid;  // 最高投标

    mapping(address => uint) pendingReturns; ///可以取回的之前的出价

    bool ended;  // 拍卖结束后设为 true，将禁止所有的变更

    // 变更触发的事件
    event HighestBidIncreased(address bidder, uint amount);
    event AuctionEnded(address winner, uint amount);

    constructor(uint _biddingTime, address payable _beneficiary){
        beneficiary = _beneficiary;  // 受益人
        auctionEnd = block.timestamp + _biddingTime;  // 投标结束时间
    }

    // 出价竞拍
    function bid() public payable {
        // 条件一：是否在竞拍规定时间内
        require(block.timestamp <= auctionEnd, "Auction already ended."); 
        // 条件二：出价是否操作最高价
        require(msg.value > highestBid, "There already is a higher bid.");
        // 如果价格之前最高价已存在
        if (highestBid !=0) {
            // 将之前的最高价记录在映射中
            pendingReturns[highestBidder] += highestBid;
        }

        highestBidder = msg.sender; // 更换最高得主
        highestBid = msg.value; // 更换最高价
        emit HighestBidIncreased(msg.sender, msg.value);

    }



}

